
-- =====================================================
-- COMPREHENSIVE DATABASE SCHEMA WITH COMPLETE SALES DATA
-- =====================================================

-- Drop tables if they exist (in correct order due to foreign keys)
DROP TABLE IF EXISTS Sales;
DROP TABLE IF EXISTS InventoryMovements;
DROP TABLE IF EXISTS MarketingCampaigns;
DROP TABLE IF EXISTS Products;
DROP TABLE IF EXISTS Customers;
DROP TABLE IF EXISTS Suppliers;
DROP TABLE IF EXISTS Employees;

-- Create Suppliers table
CREATE TABLE Suppliers (
    SupplierID VARCHAR(10) PRIMARY KEY,
    CompanyName VARCHAR(100) NOT NULL,
    ContactPerson VARCHAR(100),
    Email VARCHAR(100),
    Phone VARCHAR(20),
    Address TEXT,
    Country VARCHAR(50),
    PaymentTerms VARCHAR(20),
    Rating DECIMAL(2,1),
    YearsPartnership INT,
    LastOrderDate DATE
);

-- Create Products table
CREATE TABLE Products (
    ProductID VARCHAR(10) PRIMARY KEY,
    ProductName VARCHAR(200) NOT NULL,
    Category VARCHAR(50),
    SupplierID VARCHAR(10),
    UnitPrice DECIMAL(10,2),
    StockLevel INT,
    MinStockLevel INT,
    LastRestocked DATE,
    Discontinued BIT DEFAULT 0,
    Weight_kg DECIMAL(5,2),
    Dimensions VARCHAR(50),
    WarrantyMonths INT,
    FOREIGN KEY (SupplierID) REFERENCES Suppliers(SupplierID)
);

-- Create Customers table
CREATE TABLE Customers (
    CustomerID VARCHAR(10) PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    Email VARCHAR(100),
    Phone VARCHAR(20),
    City VARCHAR(50),
    PostalCode VARCHAR(10),
    Street VARCHAR(200),
    SignupDate DATE,
    Status VARCHAR(20),
    MembershipLevel VARCHAR(20),
    TotalPurchases DECIMAL(10,2),
    LastPurchaseDate DATE
);

-- Create Employees table
CREATE TABLE Employees (
    EmployeeID VARCHAR(10) PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    Email VARCHAR(100),
    Phone VARCHAR(20),
    Department VARCHAR(50),
    Position VARCHAR(50),
    HireDate DATE,
    Salary DECIMAL(10,2),
    ManagerID VARCHAR(10),
    LastReviewDate DATE,
    Rating DECIMAL(2,1),
    GoalsMet INT,
    FOREIGN KEY (ManagerID) REFERENCES Employees(EmployeeID)
);

-- Create Sales table
CREATE TABLE Sales (
    SaleID INT PRIMARY KEY,
    SaleDate DATE,
    CustomerID VARCHAR(10),
    ProductID VARCHAR(10),
    Quantity INT,
    UnitPrice DECIMAL(10,2),
    Discount DECIMAL(3,2),
    TotalAmount DECIMAL(10,2),
    SalesChannel VARCHAR(20),
    PaymentMethod VARCHAR(20),
    SalespersonID VARCHAR(10),
    Region VARCHAR(20),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID),
    FOREIGN KEY (ProductID) REFERENCES Products(ProductID),
    FOREIGN KEY (SalespersonID) REFERENCES Employees(EmployeeID)
);

-- Create Inventory Movements table
CREATE TABLE InventoryMovements (
    MovementID VARCHAR(10) PRIMARY KEY,
    MovementDate DATE,
    ProductID VARCHAR(10),
    MovementType VARCHAR(20),
    Quantity INT,
    Location VARCHAR(50),
    Reference VARCHAR(20),
    Notes TEXT,
    FOREIGN KEY (ProductID) REFERENCES Products(ProductID)
);

-- Create Marketing Campaigns table
CREATE TABLE MarketingCampaigns (
    CampaignID VARCHAR(10) PRIMARY KEY,
    CampaignName VARCHAR(200),
    Type VARCHAR(50),
    StartDate DATE,
    EndDate DATE,
    Budget DECIMAL(10,2),
    TargetAudience VARCHAR(20),
    Impressions INT,
    Clicks INT,
    ClickRate DECIMAL(6,4),
    Conversions INT,
    ConversionRate DECIMAL(6,4),
    Cost DECIMAL(10,2)
);

